import "./Body.css";

function Body() {
  return (
    <div className="bodyContainer">
      <img className="myPicture" src="me.jpg" alt="me" />
      <p className="bodyText">
        Hi, I'm Nicholas Clark <br />
        <br />I am a computer science student working hard to begin a
        professional career
      </p>
    </div>
  );
}

export default Body;
